// Performance.js

import React, { useEffect, useState } from 'react';
import { fetchPerformanceResults } from '../utils/api';
import { LineChart, Line, CartesianGrid, XAxis, YAxis, Tooltip, Legend, ResponsiveContainer } from 'recharts';

const Performance = () => {
  const [data, setData] = useState({ actual: [], predicted: [] });
  const [showChart, setShowChart] = useState(false);

  useEffect(() => {
    const fetchData = async () => {
      const result = await fetchPerformanceResults();
      setData(result);
    };
    fetchData();
  }, []);

  const chartData = data.actual.map((value, index) => ({
    name: `User ${index + 1}`,
    Actual: value,
    Predicted: data.predicted[index],
  }));

  return (
    <div>
      <h2>Twitter Performance Prediction</h2>
      <button onClick={() => setShowChart(!showChart)}>
        {showChart ? 'Hide Chart' : 'Show Chart'}
      </button>
      {showChart && (
        <ResponsiveContainer width="100%" height={400}>
          <LineChart data={chartData} margin={{ top: 5, right: 30, left: 20, bottom: 5 }}>
            <Line type="monotone" dataKey="Actual" stroke="#8884d8" />
            <Line type="monotone" dataKey="Predicted" stroke="#82ca9d" />
            <CartesianGrid stroke="#ccc" />
            <XAxis dataKey="name" />
            <YAxis />
            <Tooltip />
            <Legend />
          </LineChart>
        </ResponsiveContainer>
      )}
    </div>
  );
};

export default Performance;
